interface AccessPoint {
    accessEnv: string;
    http: {
        openApiHost: string;
        ssoSvHost: string;
    };
    id: string;
    loginUrl: string;
    thrift: any;
}
export interface ConfigsInConfigInfo {
    accessPoint: AccessPoint;
}
export interface ConfigInfo {
    digest: string;
    configs: ConfigsInConfigInfo;
}
interface ExchangeParamsBase {
    version: string;
    cmd: string;
}
export interface ExchangeParamsRequest extends ExchangeParamsBase {
    params: {
        accessEnv: string;
    };
}
export interface SSOWebConfig {
    clientId: string;
    accessEnv: "test" | "product" | "ppe";
    callbackUrl?: string;
    logoutUri?: string;
    includeUrl?: string;
    includedUriList?: string;
    excludeUriList?: string;
    rewriteLocation?: string;
    schema?: string;
    sameSite?: boolean;
}
export interface ExchangeParamsReport extends ExchangeParamsBase {
    params: {
        ssoConfigs: {
            digest: string;
            configs: any;
        };
        clientInfo: {
            sdkVersion: string;
            env: string;
            clientId: string;
            ip: string;
        };
    };
}
export {};
